#include <iostream>
using namespace std;


string removeDuplicates(string s) {
    bool duplicatePresent = false;

    while(1) {

        if (s.length() == 1){
            break;
        }

        int i = 0;
        int j = 1;

        while(j<s.length()){
            if (s[i] == s[j]){
                duplicatePresent = true;
                break;
            }
            i++;
            j++;
        }

        if (duplicatePresent){
            s.erase(i,2);
        }
        else{
            break;
        }

        duplicatePresent = false;
    }

    return s;
}

int main(){
    string s = "" ;

    string answer = removeDuplicates(s);
    cout<<"WORKS ON LEETCODE BUT HAS BAD TIME COMPLEXITY !"<<endl;
    cout<<answer;

}
